import Login from './Views/Login/login'
import {useSelector} from 'react-redux'
function App() {
  const{auth} = useSelector(state=> state)
  return (
    <>
    {!auth.LoggdnIn ? <Login /> : <h1>Hello</h1>}
    </>
  );
}

export default App;
